Priscilla Paints Natural Splendors, Book 1, contains original designs and patterns for more than a dozen nature-inspired Tole and Decorative painting projects on raw wood with tree bark acting as a &quot;frame.&quot; Full color photos of projects and painting worksheets are included, along with a full-size pull-out pattern section. Projects include hummingbird, nest with eggs, fishing gear and a fawn.

