Priscilla Hauser is an internationally known Tole and Decorative Painter. She is credited with founding the National Society of Tole and Decorative Painters, appearing on many national television programs to demonstrate techniques, and has written more than 80 books. She is affectionately known as the &quot;First Lady of Tole Painting.&quot;
